import React from 'react';

const AboutSection = () => {
  return (
    <section id="about-section" className="about-section">
      <h2 className="section-title">About</h2>
      <p>
        This is a chat app built with React. It allows you to start conversations based on search terms and displays the conversation history.
      </p>
    </section>
  );
};

export default AboutSection;
